import React, { Component } from 'react'
import ReactTable from "react-table";  

export default class Userdaata extends Component {

  render() {
    return (
      <div className='settings-wrapper'>
          <div>
            <table>
            <thead>
                <tr>Name</tr>
                <tr>Email</tr>
            </thead>
            <tbody>
            {this.getRowsData()}
            </tbody>
            </table>
            </div>
      </div>
    )
  }
}
